USE WeShare;

CREATE TABLE `Coworker`
(
  `coworker_id` integer NOT NULL AUTO_INCREMENT ,
  `first_name`  varchar(45) NOT NULL ,
  `last_name`   varchar(45) NOT NULL ,
  `email`       varchar(45) NOT NULL ,
  `gender`      VARCHAR(45) NOT NULL ,
  `username`    VARCHAR(45) NOT NULL ,
	`password`    VARCHAR(60) NOT NULL ,
  `address`     varchar(45) NOT NULL ,
  `postal_area` varchar(45) NOT NULL ,
  `city`        varchar(45) NOT NULL ,
  `state`       varchar(45) NOT NULL ,
  `country`     varchar(45) NOT NULL ,
  PRIMARY KEY (`coworker_id`)
);

CREATE TABLE `Manager`
(
  `manager_id` integer NOT NULL,
	`first_name` VARCHAR(50),
	`last_name` VARCHAR(50),
	`email` VARCHAR(50),
	`address` VARCHAR(50),
	`postal_area` VARCHAR(50),
	`city` VARCHAR(50),
	`state` VARCHAR(50),
	`country` VARCHAR(50),
  PRIMARY KEY (`manager_id`)
);

CREATE TABLE `CoworkingSpace`
(
  `cws_id`      integer NOT NULL ,
  `name`        varchar(45) NOT NULL ,
  `address`     varchar(45) NOT NULL ,
  `image_url`   varchar(2083) ,
  `currency`    char(3) NOT NULL ,
  `day_price`   integer NOT NULL ,
  `description` varchar(2000) NOT NULL ,
  `rating`      float ,
  `postal_area` varchar(10) NOT NULL ,
  `city`        varchar(45) NOT NULL ,
  `state`       varchar(45) NOT NULL ,
  `country`     varchar(45) NOT NULL ,
  `latitude`    float NOT NULL ,
  `longitude`   float NOT NULL ,
  `week_price`  integer NOT NULL ,
  `month_price` integer NOT NULL ,
  `manager_id`  integer NOT NULL ,
  PRIMARY KEY (`cws_id`),
  FOREIGN KEY (`manager_id`) REFERENCES `Manager` (`manager_id`)
);

CREATE TABLE `Review`
(
  `title`       varchar(45) NOT NULL ,
  `comment`     varchar(2000) NOT NULL ,
  `rating`      float NOT NULL ,
  `cws_id`          integer NOT NULL ,
  `coworker_id` integer NOT NULL ,
  PRIMARY KEY (`cws_id`, `coworker_id`),
  FOREIGN KEY (`coworker_id`) REFERENCES `Coworker` (`coworker_id`),
  FOREIGN KEY (`cws_id`) REFERENCES `CoworkingSpace` (`cws_id`)
);







